account.descriptionLink:
Determine the minting cost of the DED NFT collection.

When voting, please consider our initial goals with the NFT project:

a) to continue building a tight-knit community around $DED, utilizing the NFT as a new voting mechanism/entry pass to our DAO;
b) to create a multi-sig community DAO wallet with the majority of the mint proceeds, greatly reducing the circulating supply of $DED;
c) to enabled & pave the way for a continued expansion of the project over the next cycle.

1 $DED = 1 $DED
